import React from 'react';
import Book from './Book';
import './BooksAvailable.css'; // Import CSS file

function BooksAvailable({ books }) {
  return (
    <>
      <h2>Books Available</h2>
       {/* Apply class name */}
        {books.map((book) => (
          <Book key={book.id}
          image={book.imageUrl}
          name={book.title}
          author={book.author}
          rating={book.ratings}
          price={book.price}/>
